    $("#box2").on("change", function(){
       var sel = $(this).find(":selected").data("type");

       if (sel == "stillb"){
           $(".stillb").show();
           $(".meas").css('visibility', 'visible');
           $(".infant").hide();
           $(".nonstillb").hide();
       } else if (sel == "infant"){
           $(".stillb").hide();
           $(".meas").css('visibility', 'visible');
           $(".infant").show();
           $(".nonstillb").hide();
       } else {
           $(".stillb").hide();
           $(".meas").css('visibility', 'hidden');
           $(".infant").hide();
           $(".nonstillb").show();
       }

    });



